import React from "react";
import { Routes, Route } from "react-router-dom";
import BotsPage from "./BotsPage";
import BotSpecs from "./BotSpecs";

function App() {
  return (

      <Routes>
        <Route path="/" element={<BotsPage />} />
        <Route path="/bot/:id" element={<BotSpecs />} />
      </Routes>

  );
}

export default App;
